import '../styles/Global.css';
import { Link } from "react-router-dom";
import { Navbar } from '../components/Navbar';
import { Footer } from '../components/Footer';
export function Login (){
    return (
        <div className="login">
            <Navbar/>
            <div >
                <h1>LOGIN</h1>
            </div>
            <Footer/>
        </div>
    )
}
